import React from 'react';
import { Link } from 'react-router-dom'

const Home = () => {
    return ( 
        <div>
            <h2>Bienvenidos, a la <Link to="/" className='logo'>Spanish Conjugator</Link></h2>
            <p><b>What would you like to do?</b></p>
            <div className='box'>
            <Link to='/random' style={{color: 'grey'}}><b>Practice with random verbs</b></Link>
            <p>Translate different verbs, tenses, and forms</p>
            </div>
        </div>
     );
}

export default Home;
